import { useEffect, useState } from "react";
import { API } from "./api";

export default function AdminBookings() {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    fetch(API + "/bookings/admin")
      .then(res => res.json())
      .then(data => setBookings(data));
  }, []);

  return (
    <>
      <div className="nav">
        <h2>üõ†Ô∏è Admin ‚Äì All Bookings</h2>
      </div>

      <div className="container">
        <div className="card" style={{ width: "90%" }}>
          <table width="100%" border="1" cellPadding="10">
            <thead>
              <tr>
                <th>User</th>
                <th>Destination</th>
                <th>Country</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {bookings.map((b, i) => (
                <tr key={i}>
                  <td>{b.username}</td>
                  <td>{b.name}</td>
                  <td>{b.country}</td>
                  <td>{b.date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
}
